import { Component, OnInit, VERSION, ElementRef, ViewChild } from '@angular/core';
import { AreaModel } from 'src/app/models/area';
import { FuncionarioModel } from 'src/app/models/funcionario';
import { AreaService } from 'src/app/services/area.service';
import { FuncionarioService } from 'src/app/services/funcionario.service';
import { FormBuilder, Validators } from '@angular/forms';
import { AsistenciasService } from 'src/app/services/asistencias.service';
import { AsistenciaModel } from 'src/app/models/asistencia';
import { DatePipe } from '@angular/common';
import Swal from 'sweetalert2';
import * as moment from 'moment';
import * as XLSX from 'xlsx';

import pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';
pdfMake.vfs = pdfFonts.pdfMake.vfs;
import htmlToPdfmake from 'html-to-pdfmake';

import { Margins, Alignment } from 'pdfmake/interfaces';

interface PlanillaAsistencia{
  dia: string;
  fecha: string;
  horario: string;
  entradaP: string;
  salidaP: string;
  entradaS: string;
  salidaS: string;
  obsEntradaP: number;
  obsSalidaP: string; 
  obsEntradaS: string;
  obsSalidaS: string; 
  colorE: string;
  colorS: string;
}

@Component({
  selector: 'app-asistencias',
  templateUrl: './asistencias.component.html',
  styleUrls: ['./asistencias.component.scss']
})
export class AsistenciasComponent implements OnInit{

  eps95logo = 'data:image/png;base64,';
  areas_data: AreaModel[]=[];
  funcionarios_data: FuncionarioModel[]=[]; 
  
  datosFuncionario: any = "";
  datosArea: any = "";

  totalAtrasos: any = 0; 
  fin: any = "";
  ffi: any = "";
  
  asistencias: AsistenciaModel[]=[];
  planilla: PlanillaAsistencia[] = [];
  r: any[] = [];  

  seleccionarArea: string = "Cambiar Area"
  fechas: Date[]= [];
  confirmacionDescarga: any = "";

  constructor(private formBuilder: FormBuilder, private areaService: AreaService, private funcionarioService: FuncionarioService, private asistenciaService: AsistenciasService){}

  listAreas(){
    this.areaService.getAreas().subscribe(areas=>{
      this.areas_data = areas;
      //console.log(this.areas_data);
    })
  }

  funcionariosForm = this.formBuilder.group({
    area: [null, Validators.required],
    funcionario: [null, Validators.required],
    f_inicio: [null, Validators.required],
    f_final: [null, Validators.required],
  });

  get area() {
    return this.funcionariosForm.get('area');
  }

  get funcionario(){
    return this.funcionariosForm.get('funcionario');
  }

  get f_inicio(){
    return this.funcionariosForm.get('f_inicio');
  }

  get f_final(){
    return this.funcionariosForm.get('f_final');
  }

  onAreaChange(){
    console.log(this.area?.value);
    this.asistenciaService.getFuncionariosbyAreas(this.area?.value).subscribe(f =>{
      this.funcionarios_data = f;
    });

    this.areaService.getArea(String(this.area?.value)).subscribe(a => {
      this.datosArea = a;
    })
    return this.datosArea['nombre_dep'];
  }

  onFuncionarioChange(){
    console.log(this.funcionario?.value);
    var idF  = this.funcionario?.value;
    this.funcionarioService.getFuncionario(String(idF)).subscribe(f => {
      this.datosFuncionario = f;
    })
    return this.datosFuncionario['paterno']+" "+ this.datosFuncionario['materno'] + " "+ this.datosFuncionario['nombre'];
  }

  onFormSubmit(){
    this.fin = this.f_inicio?.value;
    this.ffi = this.f_final?.value;

    let finicio = new Date(this.fin);
    let fini = new Date(this.fin);
    let ffinal = new Date(this.ffi);

    Swal.fire({
      title:'Cargando...',
      text: 'Obteniendo Marcaciones',
      icon: 'info',
      allowOutsideClick: false
    });
    Swal.showLoading();

    
    let dif = ((ffinal.getTime()-finicio.getTime())/86400000)+1;
    
    var incremento = 0;
    var inicio = this.fin;

    if(this.funcionario!.value == 'todo'){
      console.log(this.funcionario?.value+"tooooooooo")
      for(let ids of this.funcionarios_data){
        this.planillaMarcacion(ids.id);
      }
    }
    else{
      this.planillaMarcacion(this.funcionario?.value);

    }
    console.log(dif);

    
    console.log(this.fechas);
    
    this.fechas.push(this.sumarDias(finicio,0).toString());

  }


  planillaMarcacion(funcionarioid: any){
    this.fin = this.f_inicio?.value;
    this.ffi = this.f_final?.value;

    let finicio = new Date(this.fin);
    let fini = new Date(this.fin);
    let ffinal = new Date(this.ffi);

    Swal.fire({
      title:'Cargando...',
      text: 'Obteniendo Marcaciones',
      icon: 'info',
      allowOutsideClick: false
    });
    Swal.showLoading();

    
    let dif = ((ffinal.getTime()-finicio.getTime())/86400000)+1;
    
    var incremento = 0;
    var inicio = this.fin;
    this.asistenciaService.getAsistenciasFuncionario(funcionarioid, fini, ffinal).subscribe(a=>{
        this.asistencias = a;
  
  
  
      
        this.planilla = [];
        this.totalAtrasos = 0;
        for (let i = 1; i <= dif; i++) {
          
          
          var ent: any = "d";
          //console.log(da);
          var entrada: any[] = [];
          var salida: any[] = [];
          
          var max: Date = new Date(0);
          var min: Date = new Date(0);
  
          for (let asis of this.asistencias) {        
            
            let fecha = new Date(asis.hora_registro).toUTCString();
  
            if(moment(fecha).format('YYYY/MM/DD') == moment(finicio).format('YYYY/MM/DD')){
              //console.log("fecha principal"+fecha);
              //console.log("si");
  
              //console.log(moment(finicio.toUTCString()).format('HH:mm:ss'));
              //console.log(moment.utc(fecha).add(24, 'hours').format('HH:mm:ss'));
  
              //console.log(new Date(0, 0, 0, 6, 0, 0));
  
              if(moment(new Date(0, 0, 0, 6, 0, 0)).add(24, 'hours').format('HH:mm:ss') <= moment.utc(fecha).add(24, 'hours').format('HH:mm:ss') && moment.utc(fecha).add(24, 'hours').format('HH:mm:ss') <= moment(new Date(0, 0, 0, 11, 59, 0)).add(24, 'hours').format('HH:mm:ss')){
                entrada.push(new Date(fecha));
                min = new Date(Math.min.apply(null,entrada));
              }else{
                salida.push(new Date(fecha));
                max = new Date(Math.min.apply(null,salida));
              }
              
            }
            else{
              //inicio = this.sumarDias(new Date(inicio),1);
              //console.log(moment(fecha).format('YYYY/MM/DD'));
              //console.log(moment(inicio).format('YYYY/MM/DD'));
            }
            
          }
  
          var da=finicio;
          if(da.getUTCDay() != 0 && da.getUTCDay() != 6){
            var dfe = "";
            var dfs = "";
            var redAdvertenciaE = "";
            var redAdvertenciaS = "";
            var obsEntrada = 0;
            var obsSalida = null;
  
            if(moment.utc(min).add(24, 'hours').format('HH:mm:ss') === '00:00:00'){
              dfe = "-";
              redAdvertenciaE = 'background-color: #de9898;';
            }
            else{
              dfe = moment.utc(min).add(24, 'hours').format('HH:mm:ss');
              if(moment.utc(min).add(24, 'hours').format('HH') >= '09'){
  
                if(moment.utc(min).add(24, 'hours').format('mm:ss') > '10:59' || moment.utc(min).add(24, 'hours').format('HH') >= '10'){
                  //console.log(moment.utc(min).add(24, 'hours').format('mm:ss'));//
                  redAdvertenciaE = 'background-color: #de9898;';
                  obsEntrada = (new Date(min.getUTCFullYear(),min.getUTCMonth(), min.getUTCDate(),min.getUTCHours(),min.getUTCMinutes(),0,0).getTime() - new Date(min.getUTCFullYear(),min.getUTCMonth(), min.getUTCDate(),9,0,0,0).getTime())/(1000*60);
                  this.totalAtrasos = this.totalAtrasos + obsEntrada;
  
                }
              }
            }
            if(moment.utc(max).add(24, 'hours').format('HH:mm:ss') === '00:00:00'){
              dfs = "-";
              redAdvertenciaS = 'background-color: #de9898;';
            }else{
              dfs = moment.utc(max).add(24, 'hours').format('HH:mm:ss');
              if(moment.utc(max).add(24, 'hours').format('HH:mm:ss') < '17:00:00'){
                redAdvertenciaS = 'background-color: #de9898;';
              }
              
            }
  
            //console.log("maxima:  "+max);
            this.planilla.push({
              dia: da.toString(),
              fecha: da.toString(),
              horario: 'Continuo',
              entradaP: dfe,
              salidaP: dfs,
              entradaS: '',
              salidaS: '',
              obsEntradaP: obsEntrada,
              obsSalidaP: '',
              obsEntradaS: '',
              obsSalidaS: '',
              colorE: redAdvertenciaE,
              colorS: redAdvertenciaS
            });
          }
  
        
          da=this.sumarDias(finicio,1)
          
        }
        console.log(this.planilla);
        
  
        
  
        
        
  
        Swal.fire({
          title: 'Item',
          text: 'Completado',
          icon: 'success'
        });
        //console.log(this.asistencias);
      });
      console.log(dif); 
      console.log(this.fechas);

      this.fechas.push(this.sumarDias(finicio,0).toString());
  }

  sumarDias(fecha: any, dias: any){
    fecha.setDate(fecha.getDate() + dias);
    return fecha;
  }

  descargarMarcaciones(){
    Swal.fire({
      title:'Descargando Marcaciones...',
      text: 'Espere un momento',
      icon: 'info',
      allowOutsideClick: false,
      timerProgressBar: true,
    });
    Swal.showLoading();

    this.asistenciaService.getDescargarAsistencias().subscribe(resp => {
      this.confirmacionDescarga = resp;
      console.log(this.confirmacionDescarga);
      Swal.fire({
        title: 'Marcaciones',
        text: this.confirmacionDescarga['message'],
        icon: 'success'
      });
    });
    
  }

  
  nombreArchivo = ''+new Date().toLocaleString()+'.xlsx';
  exportToExcel(): void {
    let element = document.getElementById('marcaciones');
    const worksheet: XLSX.WorkSheet = XLSX.utils.table_to_sheet(element);

    const book: XLSX.WorkBook = XLSX.utils.book_new();
    XLSX.utils.book_append_sheet(book, worksheet, 'Biometrico');

    XLSX.writeFile(book, this.nombreArchivo);
  }

  title = 'htmltopdf';

  @ViewChild('pdfReporte') pdfTable: ElementRef;
  

  downloadAsPDF() {
    const pdfTable = this.pdfTable.nativeElement;
    var html = htmlToPdfmake(pdfTable.innerHTML);

    const documentDefinition = { content: [
      { columns: [
          {
            image: this.eps95logo,
            width: 70,
            height: 70
          },
          {
            text: [
              '\n\n',
              {text: 'Concejo Municipal de La Paz \n', style: "header", },
              {text: 'Gobierno Autonomo Municipal de La Paz', alignment: 'center' as Alignment},
            ]
          }
        ]
      },
      { text: "  "},
      { text: "  "},      
      { text: "Nombres y Apellidos: "+ this.onFuncionarioChange(), style: "titulo"},
      { text: "Area: "+ this.onAreaChange(), style: "titulo"},
      { text: "Correspondiente al Periodo: "+ moment(this.f_inicio?.value).format('YYYY/MM/DD')+ " al "+ moment(this.f_final?.value).format('YYYY/MM/DD'), style: "titulo"},
      { text: "  "},
      html
    ],

    defaultStyle: {
      fontSize: 10,
      width: 100,
      height: 100
    },
    styles: {
      header: {
        fontSize: 17,
        bold: true,
        alignment: 'center' as Alignment
      },
      titulo: {
        bold: true,
      }
    }
  };
    pdfMake.createPdf(documentDefinition).open();
  }
  

  
  ngOnInit(): void {
    this.listAreas();
  }
}
